import React, { useState } from 'react';
import data from './data';
import List from './List';
function App() {
  const [peopleData, setPeopleData] = useState(data);

  return (
    <div className="h">
      {peopleData.map(people => (
        <div className="container">
          <h4></h4>
        </div>
      ))}
    </div>
  );
}

export default App;

